#version 300 es

            uniform perScene {
                mat4 projectionMatrix;
                mat4 viewMatrix;
                float iGlobalTime;
            };

            uniform perModel {
                mat4 modelMatrix;
                mat4 normalMatrix;
            };

            in vec3 a_position;
            in vec3 a_normal;
            in vec2 a_uv;

            out vec2 v_uv;

            void main() {
                vec4 position = viewMatrix * modelMatrix * vec4(a_position, 1.0);
                gl_Position = projectionMatrix * position;
                v_uv = a_uv;
            }

